import { PrimeNGModule } from 'src/app/material/primemg.module';
import { AddPlanStepsModule } from '../add-plan-steps/add-plan-steps.module';



@NgModule({
  declarations: [
    AddEditPlanStepsComponent
  ],
  imports: [
    CommonModule,
    PrimeNGModule,
    ReactiveFormsModule,
    FormsModule,
    MatDialogModule,
    MaterialModule,
    AddPlanStepsModule
  ],
  exports:[AddEditPlanStepsComponent]
})
